import React, { Component } from 'react'
import './App.scss';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Project from './components/Project';
import About from './components/About';
import Home from './components/Home';
import Footer from './components/Footer';
import Navbars from './components/Navbars';
import Particles from "react-tsparticles";
export class App extends Component
{

  particlesInit(main)
  {
    console.log(main);

    // you can initialize the tsParticles instance (main) here, adding custom shapes or presets
  }

  particlesLoaded(container)
  {
    console.log(container);
  }

  render()
  {
    return (

      <div className="App">

        <Particles
          id="tsparticles"
          init={this.particlesInit}
          loaded={this.particlesLoaded}
          options={{
            background: {
              color: {
                value: '#000000',
              },
            },
            fpsLimit: 60,
            interactivity: {
              detectsOn: "canvas",
              events: {
                onClick: {
                  enable: true,
                  mode: "push",
                },
                onHover: {
                  enable: true,
                  mode: "repulse",
                },
                resize: true,
              },
              modes: {
                bubble: {
                  distance: 400,
                  duration: 2,
                  opacity: 0.8,
                  size: 40,
                },
                push: {
                  quantity: 4,
                },
                repulse: {
                  distance: 200,
                  duration: 0.4,
                },
              },
            },
            particles: {
              color: {
                value: "#f9fc2d",
              },
              links: {
                color: "#ffffff",
                distance: 150,
                enable: false,
                opacity: 0.5,
                width: 1,
              },
              collisions: {
                enable: true,
              },
              move: {
                direction: "none",
                enable: true,
                outMode: "bounce",
                random: false,
                speed: 2,
                straight: false,
              },
              number: {
                density: {
                  enable: true,
                  value_area: 800,
                },
                value: 80,
              },
              opacity: {
                value: 0.5,
              },
              shape: {
                type: "star",
              },
              size: {
                random: true,
                value: 5,
              },
            },
            detectRetina: true,
          }}
        >
          <BrowserRouter>
            <Navbars />
            <Switch>
              <Route exact path="/">
                <Home />
              </Route>
              <Route exact path="/projects">
                <Project />
              </Route>
              <Route path="/about">
                <About />
              </Route>
            </Switch>
          </BrowserRouter>
          <Footer />
        </Particles>

      </div>
    )
  }
}

export default App
